import React from 'react';
import classNames from 'classnames';
import './Button.scss';

// size: large, medium, small
function Button({ children, size, color, outline }) {
  return (
    <div>
      <button className={classNames('Button', size)}>{children}</button>
    </div>
  );

  Button.defaultProps = {
    size: 'medium',
  };
}

export default Button;
